import React, { useState } from 'react';
import { Ship, FileText, Wrench, Calendar, Hash, Info, Plus } from 'lucide-react';

function AddVessel({ onSubmit }) {
  const [vesselData, setVesselData] = useState({
    // Informations de base
    vesselName: '',
    imoNumber: '',
    vesselType: '',
    yearBuilt: '',
    flag: '',

    // Caractéristiques techniques
    length: '',
    beam: '',
    draft: '',
    grossTonnage: '',
    deadWeight: '',

    // Équipements principaux
    mainEngine: {
      brand: '',
      model: '',
      power: '',
      rpm: ''
    },
    auxiliaryEngines: [
      {
        brand: '',
        model: '',
        power: '',
        rpm: ''
      }
    ],
    generators: [
      {
        brand: '',
        model: '',
        power: '',
        type: ''
      }
    ],

    // Certifications
    certificates: [
      {
        name: '',
        issueDate: '',
        expiryDate: '',
        issuingAuthority: ''
      }
    ]
  });

  const vesselTypes = [
    'Tanker',
    'Container Ship',
    'Bulk Carrier',
    'General Cargo',
    'Car Carrier',
    'LNG Carrier',
    'Passenger Ship',
    'Fishing Vessel',
    'Offshore Support'
  ];

  const handleChange = (e) => {
    const { name, value } = e.target;
    setVesselData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleEngineChange = (e, index = 0) => {
    const { name, value } = e.target;
    setVesselData(prev => ({
      ...prev,
      mainEngine: {
        ...prev.mainEngine,
        [name]: value
      }
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    onSubmit(vesselData);
  };

  return (
    <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
      <form onSubmit={handleSubmit} className="space-y-8">
        {/* Informations de base */}
        <div className="bg-white shadow rounded-lg p-6">
          <h2 className="text-lg font-medium text-gray-900 mb-4 flex items-center">
            <Ship className="h-5 w-5 mr-2 text-blue-500" />
            Basic Information
          </h2>

          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
            <div>
              <label className="block text-sm font-medium text-gray-700">
                Vessel Name
              </label>
              <input
                type="text"
                name="vesselName"
                value={vesselData.vesselName}
                onChange={handleChange}
                required
                className="mt-1 block w-full rounded-md border border-gray-300 shadow-sm p-2 focus:border-blue-500 focus:ring-1 focus:ring-blue-500"
              />
            </div>

            <div>
              <label className="block text-sm font-medium text-gray-700">
                IMO Number
              </label>
              <input
                type="text"
                name="imoNumber"
                value={vesselData.imoNumber}
                onChange={handleChange}
                required
                pattern="[0-9]{7}"
                title="IMO number must be 7 digits"
                className="mt-1 block w-full rounded-md border border-gray-300 shadow-sm p-2 focus:border-blue-500 focus:ring-1 focus:ring-blue-500"
              />
            </div>

            <div>
              <label className="block text-sm font-medium text-gray-700">
                Vessel Type
              </label>
              <select
                name="vesselType"
                value={vesselData.vesselType}
                onChange={handleChange}
                required
                className="mt-1 block w-full rounded-md border border-gray-300 shadow-sm p-2 focus:border-blue-500 focus:ring-1 focus:ring-blue-500"
              >
                <option value="">Select type</option>
                {vesselTypes.map(type => (
                  <option key={type} value={type}>
                    {type}
                  </option>
                ))}
              </select>
            </div>

            <div>
              <label className="block text-sm font-medium text-gray-700">
                Year Built
              </label>
              <input
                type="number"
                name="yearBuilt"
                value={vesselData.yearBuilt}
                onChange={handleChange}
                min="1900"
                max={new Date().getFullYear()}
                required
                className="mt-1 block w-full rounded-md border border-gray-300 shadow-sm p-2 focus:border-blue-500 focus:ring-1 focus:ring-blue-500"
              />
            </div>

            <div>
              <label className="block text-sm font-medium text-gray-700">
                Flag
              </label>
              <input
                type="text"
                name="flag"
                value={vesselData.flag}
                onChange={handleChange}
                required
                className="mt-1 block w-full rounded-md border border-gray-300 shadow-sm p-2 focus:border-blue-500 focus:ring-1 focus:ring-blue-500"
              />
            </div>
          </div>
        </div>

        {/* Boutons de soumission */}
        <div className="flex justify-end space-x-4">
          <button
            type="button"
            className="px-4 py-2 border border-gray-300 rounded-md text-sm font-medium text-gray-700 hover:bg-gray-50"
          >
            Cancel
          </button>
          <button
            type="submit"
            className="px-4 py-2 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-blue-600 hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500"
          >
            <Plus className="h-5 w-5 mr-2 inline" />
            Add Vessel
          </button>
        </div>
      </form>
    </div>
  );
}

export default AddVessel;
